import React from 'react';
import Checkbox from '@material-ui/core/Checkbox';

export default function CheckboxesUi(props) {

    return (
            <Checkbox
                defaultChecked
                color="primary"
                inputProps={{ 'aria-label': 'secondary checkbox' }}
            />
    );
}
